import Layout from '../components/Layout';
import { Container,  Row, Col, Form} from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';


export default () => (
    <Layout title="Personal Settings page." >
        <div class="children-box">
        <Container>
            <Row>
                <Col><Form.Text column lg={2}>Normal Text</Form.Text></Col>
            </Row>
            <Row>
                <Col>1 of 3</Col>
                <Col>2 of 3</Col>
                <Col>3 of 3</Col>
            </Row>
        </Container>
        </div>
    </Layout>
);
